import EVENT_NAMES from './events.js';
import METHOD_NAMES from './methods.js';
import MARKER_NAMES from './markers.js';
import MISC from './misc.js';

const {DEFAULT_WIDTH, DEFAULT_HEIGHT, DEFAULT_OUTPUT} = MISC;

export default {
  EVENT_NAMES,
  METHOD_NAMES,
  MARKER_NAMES,
  DEFAULT_WIDTH,
  DEFAULT_HEIGHT,
  DEFAULT_OUTPUT,
};
